export function SortData(data) {
	const test = data.split('\n');
	// console.log(typeof(test));
	console.log(test);

	test.sort((a, b) => {
		if (a[3] === b[3]) {
			return a[4] - b[4];
		}
		return a[3] - b[3];
	});

	console.log(test);
}
